article_content:
완전 마음에 듭니다. 점수를 준다면 97점입니다. 3점을 감한 이유는 시트 색이 연노랑이어서 그리고 마감처리가 약간 부족한 느끼이어서... ^^;;
전날 저녁에 주문했는데 다음날 낮에 도착했습니다. 3인용이지만 4인 식탁에 사용해도 무리가 없습니다. 4인 식탁에 2인용을 사면 식탁 안쪽으로 의자가 들어가서 깔끔하긴 하겠지만 조금 작을 것 같아서 3인용으로 구입했는데 마음에 듭니다. 벤치를 벽쪽에 놓았기 때문에 괜찮습니다.
조립 설명서나조립도는 없었지만 그래도 쉽게 다리를 조립할 수 있었어요. 제공되는 나사와 나사를 조일 수 있는 도구만으로도 쉽게 누구나 조립할 수 있ㅇ니요. 벤치 안쪽은 마감이 약간 부족한 느낌이 들지만 다리는 고급스러운 원목억 적당한 굵기이며 매끄럽게 손질 후 도색되어 있어서 아주 마음에 듭니다.
